import React,{useState} from 'react';
import {
    Form,
    FormGroup,
    Input,
    Label,
    Container,
    Button
}from 'reactstrap';

export const Forms =()=>{
    const [name,setName]=useState('');
    const [contact,setContact]=useState('');
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type="text" value={name} onChange={(e)=>setName(e.target.value)} name="name" />
                </FormGroup>
                <FormGroup>
                    <Label>Contact</Label>
                    <Input type="text" value={contact} onChange={(e)=>setContact(e.target.value)} name="contact"/>
                </FormGroup>
            </Form>
        </Container>        
    )
}
